import React from "react";

export default function RecipeCard(props) {
  console.log(props.Diets);
  const diets = props.Diets.map((diet) => diet.name);
  //   console.log(diets);
  return (
    <div>
      <img src={props.image} alt="recipe" />
      <p>ID: {props.id} </p>
      <p>Name: {props.name}</p>
      {/* <p>Dietas: {diets.map((d) => d)} </p> */}
    </div>
  );
}

RecipeCard({
  id: 234,
  name: "Salmon with roasted vegetables",
  Diets: [
    {
      id: 15,
      name: "Gluten Free",
      Recipe_Diet: {
        RecipeId: 234,
        DietId: 15,
      },
    },
    {
      id: 16,
      name: "Dairy Free",
      Recipe_Diet: {
        RecipeId: 234,
        DietId: 16,
      },
    },
    {
      id: 22,
      name: "Pescetarian",
      Recipe_Diet: {
        RecipeId: 234,
        DietId: 22,
      },
    },
  ],
});
